import React from 'react';
import "../App.css";

function Navigation() {
    return (
        <div className="Navigation">
            <div className="leftSide">
               
<div className="links">
                <a href="/MainCourse">MainCourse</a>&nbsp;&nbsp;
                <a href="/ComboOffers">ComboOffers</a>&nbsp;&nbsp;
                <a href="/Watermelon">Watermelon</a>&nbsp;&nbsp;
                <a href="/Brownies">Brownies</a>
            </div>
            </div>
           
            
        </div>
    )
}

export default Navigation
